import React, { forwardRef } from 'react';
import HeadingSection from '../HeadingSection/HeadingSection';

const Welcome = forwardRef(({ title, tagline, children }, ref) => (
  <section ref={ref} className="first-ico-box" id="about">
    <div className="container">
      <div className="row">
        <HeadingSection title={title} tagline={tagline}>
          Hi, I'm Ash. {'\n'}
          I coach men and women who are on their path to recovery and work with my clients to become the best version of themselves.
          Life can be overwhelming. I empower my clients to take back control of their lives and figure out what they want and how they are going to get it.
        </HeadingSection>
      </div>
    </div>
  </section>
));

export default Welcome;
